import React from 'react'

export default function Login() {
  return (
    <div>
       <button className="w-[100px] h-[60px] border-3 border-blue-600 rounded-[45px] transition-all duration-300 cursor-pointer bg-blue-600 text-white font-semibold text-[1.2em] hover:bg-white hover:text-blue-600 hover:text-[1.5em]">
      Button
    </button>
    </div>
  )
}
